(169,169,1,'Azienda Zero Lazio: al via il nuovo portale per una sanit pi vicina ai cittadini','azienda-zero-lazio-al-via-il-nuovo-portale-per-una-sanit-pi-vicina-ai-cittadini','news/azienda-zero-lazio-al-via-il-nuovo-portale-per-una-sanit-pi-vicina-ai-cittadini','{\"b408afbb-87b2-49ff-a118-bbc164db8b08\":{\"date\":\"2025-04-29 07:00:00\"},\"6a9503a8-5858-48cc-a225-6d40714d6e8b\":[168],\"e6c2727b-3ecc-4888-a9cc-1ed155376d32\":[],\"77d9288c-1e65-4683-9e31-274358a56209\":[],\"d5998387-72a6-4ced-bfa0-84deb9786d45\":\"<p>La Regione Lazio lancia il nuovo sito di Azienda Zero, pensato per semplificare l\'accesso ai servizi sanitari.</p>\",\"258efbfc-a9cb-4cbe-90d0-7de8dd9a8a80\":\"<p>La Regione Lazio lancia il nuovo sito di Azienda Zero, pensato per semplificare l\'accesso ai servizi sanitari, migliorare la trasparenza e facilitare la comunicazione con cittadini, operatori e fornitori. Una piattaforma moderna, accessibile e orientata all\'utente.</p>\",\"b7cb97a1-7339-495c-8406-983870d6168b\":[]}',1,'2025-05-15 14:23:32','2025-05-15 14:25:05','09df8cba-0c4b-4a6e-b9ed-f48c727eea91'),
(170,170,1,'Approvato il cronoprogramma per l\'avvio operativo di Azienda Zero Lazio','approvato-il-cronoprogramma-per-lavvio-operativo-di-azienda-zero-lazio','novita/approvato-il-cronoprogramma-per-lavvio-operativo-di-azienda-zero-lazio','{\"b408afbb-87b2-49ff-a118-bbc164db8b08\":{\"date\":\"2025-06-01 07:00:00\"},\"6a9503a8-5858-48cc-a225-6d40714d6e8b\":[168],\"e6c2727b-3ecc-4888-a9cc-1ed155376d32\":[177],\"77d9288c-1e65-4683-9e31-274358a56209\":[],\"d5998387-72a6-4ced-bfa0-84deb9786d45\":\"<p>La Giunta regionale ha deliberato il piano che porter all\'operativit completa di Azienda Zero entro il 1 gennaio 2026.</p>\",\"258efbfc-a9cb-4cbe-90d0-7de8dd9a8a80\":\"<p>La Giunta regionale ha deliberato il piano che porter all\'operativit completa di Azienda Zero entro il 1 gennaio 2026. Prevista la nomina di un Commissario Straordinario e l\'adozione dell\'atto aziendale entro fine 2025.</p>\",\"b7cb97a1-7339-495c-8406-983870d6168b\":[]}',1,'2025-05-15 14:23:35','2025-05-16 09:30:05','1aa37141-284a-491a-b016-2d8e48d8313f'),
