(543,543,1,'Riferimenti legislativi','riferimenti-legislativi',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong><u>Decreto Legislativo 14 marzo 2013, n.33</u></strong> - <i>Riordino della disciplina riguardante il diritto di accesso civico e gli obblighi di pubblicit, trasparenza e diffusione di informazioni da parte delle pubbliche amministrazioni</i> - pubblicato in Gazzetta Ufficiale n. 80 in data 05/04/2013 - in vigore dal 20/04/2013, come modificato con <strong><u>D.lgs. n. 97 del 25/05/2016</u></strong></p><p><strong><u>Decreto Legislativo 31 marzo 2023, n. 36</u></strong> - <i>Codice dei contratti pubblici in attuazione dell\'articolo 1 della legge 21 giugno 2022, n. 78, recante delega al Governo in materia di contratti pubblici</i></p><p><strong><u>Decreto legislativo n.97 del 25 maggio 2016</u></strong>, pubblicato sulla G.U. n.132 dell\'8 giugno 2016, recante <i>la revisione e la semplificazione delle disposizioni in materia di prevenzione della corruzione, pubblicit e trasparenza</i></p><p><strong><u>Delibera ANAC n. 1134/2017</u></strong> - Nuove linee guida per lattuazione della normativa in materia di prevenzione della corruzione e trasparenza da parte delle societ e degli enti di diritto privato controllati e partecipati dalle pubbliche amministrazioni e degli enti pubblici economici</p><p><strong><u>Delibera ANAC n. 264 del 20 giugno 2023</u></strong> - Provvedimento art. 28 Trasparenza</p><p>Riferimenti normativi:</p><p><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:legge:2012-11-06;190!vig=\\\"><u>Legge n. 190/2012</u></a><br /><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-03-14;33!vig=\\\"><u>Decreto Legislativo n. 33/2013</u></a><br /><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-04-08;39!vig=\\\"><u>Decreto Legislativo n. 39/2013</u></a><br /><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2016-05-25;97!vig=\\\"><u>Decreto Legislativo n. 97/2016</u></a><br /><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2023-03-31;36\\\"><u>Decreto Legislativo n. 36/2023</u></a><br /><a href=\\\"https://www.anticorruzione.it/-/determinazione-n.-1134-del-08/11/2017\\\"><u>Determinazione ANAC n. 1134/2017</u></a><br /><a href=\\\"https://www.anticorruzione.it/-/pna-2022-delibera-n.7-del-17.01.2023\\\"><u>Piano Nazionale Anticorruzione 2022 - Delibera n. 7 del 17 gennaio 2023</u></a><br /><a href=\\\"https://www.anticorruzione.it/-/delibera-n.-264-del-20-giugno-2023-provvedimento-art.-28-trasparenza\\\"><u>Delibera ANAC n. 264 del 20 giugno 2023</u></a><br /><a href=\\\"https://www.gazzettaufficiale.it/eli/id/2025/01/21/25A00305/sg\\\"><u>Delibera ANAC n. 495 del 25 settembre 2024</u></a></p>\"}',1,'2025-06-12 16:59:35','2025-06-12 16:59:35','2738a65e-6881-43ac-8ef5-42ef9067c0f7'),
(544,544,1,'Amministrazione Trasparente','amministrazione-trasparente','amministrazione-trasparente','{\"49b374db-35cb-40c5-8d99-1a6c86060047\":[],\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>I dati personali pubblicati in questa sezione sono riutilizzabili solo alle condizioni previste dalla normativa vigente sul riuso dei dati pubblici <i>(D.lgs. 18 maggio 2015, n.102, pubblicato in G. U. - Serie Generale - n. 158 del 10 luglio 2015, recante attuazione della direttiva 2013/37/UE che modifica la direttiva 2003/98/CE)</i>, in termini compatibili con gli scopi per i quali sono stati raccolti e registrati e nel rispetto della normativa in materia di protezione dei dati personali.</p><p>In questo portale saranno pubblicati, raggruppati secondo le indicazioni di legge, documenti, informazioni e dati concernenti l\'organizzazione dell\'amministrazione, le sue attivit e le relative modalit di realizzazione.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Societ trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\",\"459ebf56-1cc3-4852-82d6-a4c75891f63e\":[]}',1,'2025-06-12 16:59:35','2025-06-24 12:21:02','acea8b99-cd4a-4b7d-ae17-08a83ca2c727'),
