(556,556,1,'Riferimenti Normativi','riferimenti-normativi',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<ul><li>Legge n. 241/1990 Nuove norme in materia di procedimento amministrativo e di diritto di accesso ai documenti amministrativi;</li><li>Decreto Legislativo n. 502/1992 Riordino della disciplina in materia sanitaria, a norma dell\'articolo 1 della legge 23 ottobre 1992, n. 42;</li><li>Decreto Presidente della Repubblica n. 445/2000 Testo unico delle disposizioni legislative e regolamentari in materia di documentazione amministrativa;</li><li>Decreto Legislativo n. 165/2001 Norme generali sullordinamento del lavoro alle dipendenze delle amministrazioni pubbliche;</li><li>Decreto Legislativo n. 196/2003 Codice in materia di protezione dei dati personali (recante disposizioni per l\'adeguamento dell\'ordinamento nazionale al regolamento (UE) n. 2016/679 del Parlamento Europeo e del Consiglio del 27 aprile 2016, relativo alla protezione delle persone fisiche con riguardo al trattamento dei dati personali, nonch alla libera circolazione di tali dati e che abroga la direttiva 95/46/CE);</li><li>Decreto Legislativo n. 82/2005 Codice dellamministrazione digitale;</li><li>Decreto Legislativo n. 81/2008 Attuazione dell\'articolo 1 della Legge 3 agosto 2007, n. 123, in materia di tutela della salute e della sicurezza nei luoghi di lavoro;</li><li>Decreto Legislativo n. 150/2009 Attuazione della Legge 4 marzo 2009 n. 15, in materia di ottimizzazione della produttivit del lavoro pubblico e di efficienza e trasparenza delle pubbliche amministrazioni;</li><li>Legge n. 190/2012 Disposizioni per la prevenzione e la repressione della corruzione e dellillegalit nella pubblica amministrazione;</li><li>Decreto Legislativo n. 33/2013 Riordino della disciplina riguardante gli obblighi di pubblicit, trasparenza e diffusione di informazioni da parte delle pubbliche amministrazioni;</li><li>Decreto Legge n. 80/2021 convertito con modificazioni con Legge n. 113/2021 Misure urgenti per il rafforzamento della capacit amministrativa delle pubbliche amministrazioni funzionale allattuazione del Piano Nazionale di Ripresa e Resilienza (PNRR) e per lefficienza della giustizia;</li><li>Decreto Legislativo n. 36/2023 Codice dei contratti pubblici in attuazione dellarticolo 1 della Legge 21 giugno 2022 n. 78, recante delega al Governo in materia di contratti pubblici.</li></ul>\"}',1,'2025-06-24 08:10:31','2025-07-10 10:48:53','cab52637-09c9-4a1d-b27a-a4603a700d08'),
