(597,597,1,'Nome Organo','nome-organo',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<figure class=\\\"table\\\"><table><thead><tr><th><strong>Organi di indirizzo politico e di amministrazione e gestione, con l\'indicazione delle rispettive competenze:</strong></th><th>sezione da popolare</th></tr></thead><tbody><tr><td><strong>Atto di nomina o di proclamazione, con l\'indicazione della durata dell\'incarico o del mandato elettivo:</strong></td><td>sezione da popolare</td></tr><tr><td><strong>Curriculum vitae:</strong></td><td>sezione da popolare</td></tr><tr><td><strong>Compensi di qualsiasi natura connessi all\'assunzione della carica:</strong></td><td>sezione da popolare</td></tr><tr><td><strong>Importi di viaggi di servizio e missioni pagati con fondi pubblici</strong></td><td>sezione da popolare</td></tr><tr><td><strong>Dati relativi all\'assunzione di altre cariche, presso enti pubblici o privati, e relativi compensi a qualsiasi titolo corrisposti</strong></td><td>sezione da popolare</td></tr><tr><td><strong>Altri eventuali incarichi con oneri a carico della finanza pubblica e indicazione dei compensi spettanti</strong></td><td>sezione da popolare</td></tr><tr><td><strong>1) dichiarazione concernente diritti reali su beni immobili e su beni mobili iscritti in pubblici registri, titolarit di imprese, azioni di societ, quote di partecipazione a societ, esercizio di funzioni di amministratore o di sindaco di societ, con l\'apposizione della formula sul mio onore affermo che la dichiarazione corrisponde al vero</strong></td><td>sezione da popolare</td></tr><tr><td><strong>2) copia dell\'ultima dichiarazione dei redditi soggetti all\'imposta sui redditi delle persone fisiche</strong></td><td>sezione da popolare</td></tr><tr><td><strong>3) dichiarazione concernente le spese sostenute e le obbligazioni assunte per la propaganda elettorale ovvero attestazione di essersi avvalsi esclusivamente di materiali e di mezzi propagandistici predisposti e messi a disposizione dal partito o dalla formazione politica della cui lista il soggetto ha fatto parte, con l\'apposizione della formula sul mio onore affermo che la dichiarazione corrisponde al vero</strong></td><td>sezione da popolare</td></tr><tr><td><strong>4) attestazione concernente le variazioni della situazione patrimoniale intervenute nell\'anno precedente e copia della dichiarazione dei redditi</strong></td><td>sezione da popolare</td></tr></tbody></table></figure>\"}',1,'2025-06-24 08:45:46','2025-07-01 13:13:23','db1cf1d1-362c-473d-a914-89285e2e8988'),
(598,598,1,'Titolari di incarichi politici di cui all\'art. 14, co. 1, del dlgs n. 33/2013','titolari-di-incarichi-politici-di-cui-allart-14-co-1-del-dlgs-n-33-2013','titolari-di-incarichi-politici-di-cui-allart-14-co-1-del-dlgs-n-33-2013','{\"49b374db-35cb-40c5-8d99-1a6c86060047\":[],\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Societ Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\",\"459ebf56-1cc3-4852-82d6-a4c75891f63e\":[]}',1,'2025-06-24 08:57:19','2025-06-24 12:21:03','041c878b-29e7-4cf8-a648-07e2c8c7c4e4'),
(599,599,1,'Nome Organo','nome-organo',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Organi di indirizzo politico e di amministrazione e gestione, con l\'indicazione delle rispettive competenze:</strong></p><p><strong>Atto di nomina o di proclamazione, con l\'indicazione della durata dell\'incarico o del mandato elettivo:</strong></p><p><strong>Curriculum vitae:</strong></p><p><strong>Compensi di qualsiasi natura connessi all\'assunzione della carica:</strong></p><p><strong>Importi di viaggi di servizio e missioni pagati con fondi pubblici</strong></p><p><strong>Dati relativi all\'assunzione di altre cariche, presso enti pubblici o privati, e relativi compensi a qualsiasi titolo corrisposti</strong></p><p><strong>Altri eventuali incarichi con oneri a carico della finanza pubblica e indicazione dei compensi spettanti</strong></p><p><strong>1) dichiarazione concernente diritti reali su beni immobili e su beni mobili iscritti in pubblici registri, titolarit di imprese, azioni di societ, quote di partecipazione a societ, esercizio di funzioni di amministratore o di sindaco di societ, con l\'apposizione della formula sul mio onore affermo che la dichiarazione corrisponde al vero</strong> [Per il soggetto, il coniuge non separato e i parenti entro il secondo grado, ove gli stessi vi consentano (NB: dando eventualmente evidenza del mancato consenso) e riferita al momento dell\'assunzione dell\'incarico]</p><p><strong>2) copia dell\'ultima dichiarazione dei redditi soggetti all\'imposta sui redditi delle persone fisiche </strong>[Per il soggetto, il coniuge non separato e i parenti entro il secondo grado, ove gli stessi vi consentano (NB: dando eventualmente evidenza del mancato consenso)] (NB:  necessario limitare, con appositi accorgimenti a cura dell\'interessato o della amministrazione, la pubblicazione dei dati sensibili)</p><p>3) dichiarazione concernente le spese sostenute e le obbligazioni assunte per la propaganda elettorale ovvero attestazione di essersi avvalsi esclusivamente di materiali e di mezzi propagandistici predisposti e messi a disposizione dal partito o dalla formazione politica della cui lista il soggetto ha fatto parte, con l\'apposizione della formula sul mio onore affermo che la dichiarazione corrisponde al vero (con allegate copie delle dichiarazioni relative a finanziamenti e contributi per un importo che nell\'anno superi 5.000 ) </p><p>4) attestazione concernente le variazioni della situazione patrimoniale intervenute nell\'anno precedente e copia della dichiarazione dei redditi [Per il soggetto, il coniuge non separato e i parenti entro il secondo grado, ove gli stessi vi consentano (NB: dando eventualmente evidenza del mancato consenso)]</p>\"}',1,'2025-06-24 08:57:19','2025-06-24 08:57:19','b416ca7e-bf3d-4d33-8cf3-90f4723e36d8'),
