(700,700,1,'Tipologie di procedimento (1)','tipologie-di-procedimento','tipologie-di-procedimento','{\"49b374db-35cb-40c5-8d99-1a6c86060047\":[],\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p><strong>Per ciascuna tipologia di procedimento:</strong></p><ol><li>breve descrizione del procedimento con indicazione di tutti i riferimenti normativi utili;</li><li>unit organizzative responsabili dell\'istruttoria;</li><li>l\'ufficio del procedimento, unitamente ai recapiti telefonici e alla casella di posta elettronica istituzionale;</li><li>ove diverso, l\'ufficio competente all\'adozione del provvedimento finale, con l\'indicazione del nome del responsabile dell\'ufficio unitamente ai rispettivi recapiti telefonici e alla casella di posta elettronica istituzionale;</li><li>modalit con le quali gli interessati possono ottenere le informazioni relative ai procedimenti in corso che li riguardino;</li><li>termine fissato in sede di disciplina normativa del procedimento per la conclusione con l\'adozione di un provvedimento espresso e ogni altro termine procedimentale rilevante;</li><li>procedimenti per i quali il provvedimento dell\'amministrazione pu essere sostituito da una dichiarazione dell\'interessato ovvero il procedimento pu concludersi con il silenzio-assenso dell\'amministrazione;</li><li>strumenti di tutela amministrativa e giurisdizionale, riconosciuti dalla legge in favore dell\'interessato, nel corso del procedimento nei confronti del provvedimento finale ovvero nei casi di adozione del provvedimento oltre il termine predeterminato per la sua conclusione e i modi per attivarli;</li><li>link di accesso al servizio on line, ove sia gi disponibile in rete, o tempi previsti per la sua attivazione;</li><li>modalit per l\'effettuazione dei pagamenti eventualmente necessari, con i codici IBAN identificativi del conto di pagamento, ovvero di imputazione del versamento in Tesoreria, tramite i quali i soggetti versanti possono effettuare i pagamenti mediante bonifico bancario o postale, ovvero gli identificativi del conto corrente postale sul quale i soggetti versanti possono effettuare i pagamenti mediante bollettino postale, nonch i codici identificativi del pagamento da indicare obbligatoriamente per il versamento;</li><li>nome del soggetto a cui  attribuito, in caso di inerzia, il potere sostitutivo, nonch modalit per attivare tale potere, con indicazione dei recapiti telefonici e delle caselle di posta elettronica istituzionale.</li></ol><p></p><p><strong>SEZIONE IN COSTRUZIONE</strong></p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Sezione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\",\"459ebf56-1cc3-4852-82d6-a4c75891f63e\":[]}',1,'2025-07-03 15:45:20','2025-07-04 14:23:31','4d91efab-0d65-4a22-9332-b3fb61ce6452'),
(703,703,1,'Tipologie di procedimento (1)','tipologie-di-procedimento','tipologie-di-procedimento','{\"49b374db-35cb-40c5-8d99-1a6c86060047\":[],\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicate ed aggiornate le informazioni ed i dati concernenti le Tipologie di Procedimento e i Procedimenti ad istanza di parte:<br /><br /><strong>Per ciascuna tipologia di procedimento:</strong></p><ol><li>breve descrizione del procedimento con indicazione di tutti i riferimenti normativi utili;</li><li>unit organizzative responsabili dell\'istruttoria;</li><li>l\'ufficio del procedimento, unitamente ai recapiti telefonici e alla casella di posta elettronica istituzionale;</li><li>ove diverso, l\'ufficio competente all\'adozione del provvedimento finale, con l\'indicazione del nome del responsabile dell\'ufficio unitamente ai rispettivi recapiti telefonici e alla casella di posta elettronica istituzionale;</li><li>modalit con le quali gli interessati possono ottenere le informazioni relative ai procedimenti in corso che li riguardino;</li><li>termine fissato in sede di disciplina normativa del procedimento per la conclusione con l\'adozione di un provvedimento espresso e ogni altro termine procedimentale rilevante;</li><li>procedimenti per i quali il provvedimento dell\'amministrazione pu essere sostituito da una dichiarazione dell\'interessato ovvero il procedimento pu concludersi con il silenzio-assenso dell\'amministrazione;</li><li>strumenti di tutela amministrativa e giurisdizionale, riconosciuti dalla legge in favore dell\'interessato, nel corso del procedimento nei confronti del provvedimento finale ovvero nei casi di adozione del provvedimento oltre il termine predeterminato per la sua conclusione e i modi per attivarli;</li><li>link di accesso al servizio on line, ove sia gi disponibile in rete, o tempi previsti per la sua attivazione;</li><li>modalit per l\'effettuazione dei pagamenti eventualmente necessari, con i codici IBAN identificativi del conto di pagamento, ovvero di imputazione del versamento in Tesoreria, tramite i quali i soggetti versanti possono effettuare i pagamenti mediante bonifico bancario o postale, ovvero gli identificativi del conto corrente postale sul quale i soggetti versanti possono effettuare i pagamenti mediante bollettino postale, nonch i codici identificativi del pagamento da indicare obbligatoriamente per il versamento;</li><li>nome del soggetto a cui  attribuito, in caso di inerzia, il potere sostitutivo, nonch modalit per attivare tale potere, con indicazione dei recapiti telefonici e delle caselle di posta elettronica istituzionale.</li></ol><p></p><p><strong>Per i procedimenti ad istanza di parte:</strong></p><ol><li>atti e documenti da allegare all\'istanza e modulistica necessaria, compresi i fac-simile per le autocertificazioni</li><li>uffici ai quali rivolgersi per informazioni, orari e modalit di accesso con indicazione degli indirizzi, recapiti telefonici e caselle di posta elettronica istituzionale a cui presentare le istanze</li></ol><p><strong>SEZIONE IN COSTRUZIONE</strong></p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Sezione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\",\"459ebf56-1cc3-4852-82d6-a4c75891f63e\":[]}',1,'2025-07-03 15:53:02','2025-07-04 14:23:31','a6b34311-540f-4dfd-8171-779bbeb4dfbd'),
(705,705,1,'Tipologie di procedimento (1)','tipologie-di-procedimento','tipologie-di-procedimento','{\"49b374db-35cb-40c5-8d99-1a6c86060047\":[],\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicate ed aggiornate le informazioni ed i dati concernenti le Tipologie di Procedimento e i Procedimenti ad istanza di parte:<br /><br /><strong>Per ciascuna tipologia di procedimento:</strong></p><ol><li>breve descrizione del procedimento con indicazione di tutti i riferimenti normativi utili;</li><li>unit organizzative responsabili dell\'istruttoria;</li><li>l\'ufficio del procedimento, unitamente ai recapiti telefonici e alla casella di posta elettronica istituzionale;</li><li>ove diverso, l\'ufficio competente all\'adozione del provvedimento finale, con l\'indicazione del nome del responsabile dell\'ufficio unitamente ai rispettivi recapiti telefonici e alla casella di posta elettronica istituzionale;</li><li>modalit con le quali gli interessati possono ottenere le informazioni relative ai procedimenti in corso che li riguardino;</li><li>termine fissato in sede di disciplina normativa del procedimento per la conclusione con l\'adozione di un provvedimento espresso e ogni altro termine procedimentale rilevante;</li><li>procedimenti per i quali il provvedimento dell\'amministrazione pu essere sostituito da una dichiarazione dell\'interessato ovvero il procedimento pu concludersi con il silenzio-assenso dell\'amministrazione;</li><li>strumenti di tutela amministrativa e giurisdizionale, riconosciuti dalla legge in favore dell\'interessato, nel corso del procedimento nei confronti del provvedimento finale ovvero nei casi di adozione del provvedimento oltre il termine predeterminato per la sua conclusione e i modi per attivarli;</li><li>link di accesso al servizio on line, ove sia gi disponibile in rete, o tempi previsti per la sua attivazione;</li><li>modalit per l\'effettuazione dei pagamenti eventualmente necessari, con i codici IBAN identificativi del conto di pagamento, ovvero di imputazione del versamento in Tesoreria, tramite i quali i soggetti versanti possono effettuare i pagamenti mediante bonifico bancario o postale, ovvero gli identificativi del conto corrente postale sul quale i soggetti versanti possono effettuare i pagamenti mediante bollettino postale, nonch i codici identificativi del pagamento da indicare obbligatoriamente per il versamento;</li><li>nome del soggetto a cui  attribuito, in caso di inerzia, il potere sostitutivo, nonch modalit per attivare tale potere, con indicazione dei recapiti telefonici e delle caselle di posta elettronica istituzionale.</li></ol><p><strong>RIFERIMENTI NORMATIVI</strong><br /></p><ul><li>Art. 35, c. 1, lett. a), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. b), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. c), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. c), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. e), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. f), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. g), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. h), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. i), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. l), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. m), d.lgs. n. 33/2013</li></ul><p><strong>Per i procedimenti ad istanza di parte:</strong></p><ol><li>atti e documenti da allegare all\'istanza e modulistica necessaria, compresi i fac-simile per le autocertificazioni</li><li>uffici ai quali rivolgersi per informazioni, orari e modalit di accesso con indicazione degli indirizzi, recapiti telefonici e caselle di posta elettronica istituzionale a cui presentare le istanze</li></ol><p><strong>RIFERIMENTI NORMATIVI</strong><br /></p><ul><li>Art. 35, c. 1, lett. d), d.lgs. n. 33/2013</li><li>Art. 35, c. 1, lett. d), d.lgs. n. 33/2013 e Art. 1, c. 29, l. 190/2012<br /><br /><br /></li></ul><p><strong>SEZIONE IN COSTRUZIONE</strong></p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Sezione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\",\"459ebf56-1cc3-4852-82d6-a4c75891f63e\":[]}',1,'2025-07-03 15:55:32','2025-07-04 14:23:31','f5995cf9-c232-480e-b83d-9c9f34a1d36d'),
