(768,768,1,'Mission','mission',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>LAzienda Lazio.0  un ente del servizio sanitario regionale istituito con Legge Regionale n. 17/2021 allo scopo di supportare le aziende sanitarie locali e ospedaliere attraverso forme di integrazione di servizi tecnici e operativi a valenza regionale.</p><p>La missione dellAzienda consiste nellottimizzare aspetti organizzativi delle strutture degli enti del servizio sanitario regionale al fine di garantire un accesso equo ai servizi, la salvaguardia delle specificit territoriali e la qualit delle prestazioni.</p><p>Nellambito della propria missione istituzionale, lAzienda svolge funzioni di:</p><ol style=\\\"list-style-type:lower-latin;\\\"><li>centralizzazione del sistema dei pagamenti dei fornitori del servizio sanitario regionale;</li><li>supporto agli enti del servizio sanitario regionale nella gestione del personale;</li><li>supporto agli enti del servizio sanitario regionale nella gestione del sistema contabile;</li><li>controlli sulla appropriatezza e sulla qualit dell\'assistenza prestata dalle strutture accreditate.</li></ol>\",\"66f4e7f4-6895-4f3c-b74a-b5e3f1224c17\":{\"value\":\"{entry:12@1:url}\",\"type\":\"entry\",\"label\":\"Scopri i nostri servizi\"}}',1,'2025-07-04 04:11:46','2025-07-04 04:11:46','d138a79d-6912-49f7-87f4-6fa37fbfab4c'),
