(806,806,1,'Per Operatori Sanitari','per-operatori-sanitari',NULL,'{\"91e240e0-afa1-4309-bde2-137d89b6cc9d\":\"<p>Concorsi, formazione e strumenti digitali dedicati agli operatori per supportare il lavoro quotidiano.</p>\",\"f8ae44e0-3270-456a-80f7-49bc3a525183\":[\"116\",\"138\",\"14\",\"411\"],\"4f749405-41ed-4758-b2fa-1b3d61dc036f\":{\"value\":\"{entry:12@1:url}\",\"type\":\"entry\",\"label\":\"Scopri tutti i servizi\"}}',1,'2025-07-04 04:29:55','2025-07-04 04:29:55','dca1d2bd-d022-4034-812f-a16d6a018842'),
(809,809,1,'Come funziona','come-funziona',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il sistema, attivo da anni, copre tutte le fasi  dallordine elettronico alla chiusura contabile del credito  completamente dematerializzate. Con lobbligo della fatturazione elettronica, funge anche da intermediario tra il Sistema di Interscambio (SDI) e le ASL laziali: i fornitori inviano i lotti di fatture (FatturaPA), lo SDI li trasmette al Sistema Pagamenti, il quale li elabora, controlla la validit (es. corrispondenza IBAN, codice ordine) e li inoltra per la liquidazione</p>\"}',1,'2025-07-04 04:40:10','2025-07-04 04:48:44','45ff61d2-8c33-4c52-8332-94b8fdcf0498'),
(810,810,1,'Centralizzazione dei pagamenti','accesso-ai-concorsi-pubblici-sanitari','servizi/accesso-ai-concorsi-pubblici-sanitari','{\"07cb4be8-fe50-43de-b4d3-45cb5a6f36a9\":{\"date\":\"2025-05-09 07:00:00\"},\"28cf4146-2d58-43ef-a08f-a3a5277ec493\":[15],\"c97ade64-e007-471a-9dc8-7c7b0d97f76f\":[16,17,777],\"7da44f3a-bb6c-4e30-9e3f-e5255e3dbf02\":\"<p>Gestiamo centralmente il sistema dei pagamenti ai fornitori del servizio sanitario regionale, garantendo efficienza e trasparenza in ogni fase.</p>\",\"aa7f1052-35cc-4929-a431-ca8e42271d17\":false}',1,'2025-07-04 04:40:10','2025-07-04 04:40:10','1b4849ce-3a40-480e-ad7f-28f7bd2be4d8'),
(811,811,1,'Come funziona','come-funziona',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il sistema, attivo da anni, copre tutte le fasi  dallordine elettronico alla chiusura contabile del credito  completamente dematerializzate. Con lobbligo della fatturazione elettronica, funge anche da intermediario tra il Sistema di Interscambio (SDI) e le ASL laziali: i fornitori inviano i lotti di fatture (FatturaPA), lo SDI li trasmette al Sistema Pagamenti, il quale li elabora, controlla la validit (es. corrispondenza IBAN, codice ordine) e li inoltra per la liquidazione<br /><br /><br />Il sistema prevede percorsi distinti per:</p><ul><li><strong>Fornitori senza contratto di budget:</strong> registrazione, firma digitale dellaccordo, inserimento dati anagrafici e IBAN, trasmissione fatture manuale o via SDI<br /></li><li><strong>Soggetti con contratto di budget:</strong> registrazione tramite email ufficiale, inserimento dati dei presidi, dichiarazione IBAN digitalizzata, invio fatture e, se necessario, allegazione documenti cartacei entro 5 giorni<br /></li><li><strong>Farmacie convenzionate: </strong>allineamento automatico tra anagrafica DCROnline e Sistema Pagamenti, in base al DCA U00032/2017<br /><br />.</li></ul><p>Ogni operatore accede con credenziali (SPID/CNS/CIE o IAM), gestisce il profilo, conformandosi alle leggi sulla tracciabilit finanziaria (L.136/2010) e utilizza appositi manuali per attivare funzioni come linserimento fatture, selezione dellordine e firma digitale<br /><br /><br /><strong>Hai bisogno di supporto o vuoi inviare una comunicazione?</strong><br />Contattaci direttamente: siamo a tua disposizione per ogni richiesta sul Sistema Pagamenti.</p>\",\"66f4e7f4-6895-4f3c-b74a-b5e3f1224c17\":{\"value\":\"https://www.regione.lazio.it/imprese/salute/modulo-pagamenti-ssr\",\"type\":\"url\",\"label\":\"inviaci la tua richiesta\"}}',1,'2025-07-04 04:40:10','2025-07-04 04:40:10','2b98bacc-ea0f-443d-baba-c71448deb6a5'),
(819,819,1,'A chi  rivolto','come-funziona',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il sistema prevede percorsi distinti per:</p><ul><li><strong>Fornitori senza contratto di budget:</strong> registrazione, firma digitale dellaccordo, inserimento dati anagrafici e IBAN, trasmissione fatture manuale o via SDI<br /></li><li><strong>Soggetti con contratto di budget:</strong> registrazione tramite email ufficiale, inserimento dati dei presidi, dichiarazione IBAN digitalizzata, invio fatture e, se necessario, allegazione documenti cartacei entro 5 giorni<br /></li><li><strong>Farmacie convenzionate: </strong>allineamento automatico tra anagrafica DCROnline e Sistema Pagamenti, in base al DCA U00032/2017</li></ul>\"}',1,'2025-07-04 04:48:44','2025-07-04 04:48:44','f3e1dd0a-b897-4d87-a65b-4d24989849f2'),
(820,820,1,'Come Accedere','a-chi--rivolto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Ogni operatore accede con credenziali (SPID/CNS/CIE o IAM), gestisce il profilo, conformandosi alle leggi sulla tracciabilit finanziaria (L.136/2010) e utilizza appositi manuali per attivare funzioni come linserimento fatture, selezione dellordine e firma digitale</p>\",\"66f4e7f4-6895-4f3c-b74a-b5e3f1224c17\":{\"value\":\"https://sistemapagamenti.regione.lazio.it/cpf/faces/public/login/login.xhtml\",\"type\":\"url\",\"label\":\"Accedi al Sistema Pagamenti\"}}',1,'2025-07-04 04:48:44','2025-07-04 04:53:39','b2d32ccd-cebe-41c9-9e39-7a61f1c73739'),
(821,821,1,'Hai bisogno di supporto o vuoi inviare una comunicazione?','come-accedere',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><br />Compila il nostro form online per inviare la tua richiesta. Per aiutarci a risolvere il problema nel modo pi rapido possibile, ti chiediamo di includere:</p><ul><li>Il <strong>tuo username di accesso</strong> al Sistema Pagamenti</li><li>Eventuali <strong>file o screenshot della schermata con lerrore</strong></li><li>La <strong>data e lora</strong> in cui si  verificato il problema</li><li>Una <strong>breve descrizione</strong> della problematica riscontrata</li></ul><p>Contattaci direttamente: siamo a tua disposizione per ogni richiesta sul Sistema Pagamenti.</p>\",\"66f4e7f4-6895-4f3c-b74a-b5e3f1224c17\":{\"value\":\"https://www.regione.lazio.it/imprese/salute/modulo-pagamenti-ssr\",\"type\":\"url\",\"label\":\"inviaci la tua richiesta\"}}',1,'2025-07-04 04:48:44','2025-07-04 04:48:44','136593ee-b2fd-4cce-bb32-ad6c76275c88'),
