(833,833,1,'Cosa puoi fare','cosa-puoi-fare',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Attraverso lURP puoi:</p><ul><li><strong>Richiedere informazioni</strong> sui servizi sanitari regionali</li><li><strong>Ottenere assistenza</strong> nellutilizzo delle piattaforme digitali, come il Sistema Pagamenti</li><li><strong>Inviare segnalazioni</strong>, suggerimenti o reclami</li><li><strong>Ricevere supporto</strong> sullaccesso e la fruizione dei servizi digitali e amministrativi</li></ul>\"}',1,'2025-07-04 04:57:32','2025-07-04 04:58:40','ac8015f8-ac1b-460f-a2cd-467f9e22684e'),
(834,834,1,'Tempi di risposta','cosa-puoi-fare',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Ci impegniamo a rispondere alle richieste nel pi breve tempo possibile, secondo gli standard di qualit dei servizi pubblici.</p>\"}',1,'2025-07-04 04:58:46','2025-07-04 05:00:11','71d4875e-9a64-476c-a2b4-4396736a0c60'),
