(857,857,1,'Mission','mission',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>La missione dellAzienda</strong> consiste nellottimizzare aspetti organizzativi delle strutture degli enti del servizio sanitario regionale al fine di garantire un accesso equo ai servizi, la salvaguardia delle specificit territoriali e la qualit delle prestazioni.</p>\"}',1,'2025-07-04 05:07:04','2025-07-04 05:07:04','e00e9e0a-6e6b-4693-b1c8-c9b88dbaadb8'),
(858,858,1,'Ambito','mission',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Nellambito della propria missione istituzionale, lAzienda svolge funzioni di:</p><ol style=\\\"list-style-type:lower-latin;\\\"><li>centralizzazione del sistema dei pagamenti dei fornitori del servizio sanitario regionale;</li><li>supporto agli enti del servizio sanitario regionale nella gestione del personale;</li><li>supporto agli enti del servizio sanitario regionale nella gestione del sistema contabile;</li><li>controlli sulla appropriatezza e sulla qualit dell\'assistenza prestata dalle strutture accreditate.</li></ol>\",\"66f4e7f4-6895-4f3c-b74a-b5e3f1224c17\":{\"value\":\"{entry:12@1:url}\",\"type\":\"entry\",\"label\":\"Scopri i nostri servizi\"}}',1,'2025-07-04 05:07:04','2025-07-04 05:07:04','9e4b9119-9ae3-4263-ac43-b1966f6f706a'),
(859,859,1,'Abou us','abou-us','abou-us','{\"49b374db-35cb-40c5-8d99-1a6c86060047\":[\"771\"],\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p><i>LAzienda Lazio.0 nasce per rendere la sanit regionale pi efficiente, integrata e vicina a cittadini, operatori e fornitori. Un unico punto di accesso per scoprire servizi e novit del sistema sanitario regionale. Scopri cosa facciamo, accedi ai nostri servizi, resta aggiornato</i>.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Indice della pagina\",\"459ebf56-1cc3-4852-82d6-a4c75891f63e\":[]}',1,'2025-07-04 05:07:04','2025-07-04 14:23:32','8c1e5193-575a-4e21-b8ca-cdc79e33e491'),
(860,860,1,'Visione','mission',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>LAzienda Lazio.0  un ente del servizio sanitario regionale istituito con Legge Regionale n. 17/2021 allo <strong>scopo di supportare le aziende sanitarie locali e ospedaliere attraverso forme di integrazione di servizi tecnici e operativi a valenza regionale.</strong></p>\"}',1,'2025-07-04 05:07:04','2025-07-04 05:07:04','cf3e62da-2c04-4ae0-bc53-06ea8db1dd92'),
(861,861,1,'Mission','mission',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>La missione dellAzienda</strong> consiste nellottimizzare aspetti organizzativi delle strutture degli enti del servizio sanitario regionale al fine di garantire un accesso equo ai servizi, la salvaguardia delle specificit territoriali e la qualit delle prestazioni.</p>\"}',1,'2025-07-04 05:07:04','2025-07-04 05:07:04','e125185e-602a-4aeb-8726-8af23d57e1e5'),
