(913,913,1,'Nasce Azienda Lazio.0: approvata la legge in Consiglio Regionale','azienda-zero-lazio-al-via-il-nuovo-portale-per-una-sanit-pi-vicina-ai-cittadini','novita/azienda-zero-lazio-al-via-il-nuovo-portale-per-una-sanit-pi-vicina-ai-cittadini','{\"b408afbb-87b2-49ff-a118-bbc164db8b08\":{\"date\":\"2025-04-29 07:00:00\"},\"6a9503a8-5858-48cc-a225-6d40714d6e8b\":[\"912\"],\"e6c2727b-3ecc-4888-a9cc-1ed155376d32\":[175],\"d5998387-72a6-4ced-bfa0-84deb9786d45\":\"<p>Con l\'approvazione della proposta di legge n. 393, il Consiglio Regionale del Lazio ha istituito ufficialmente <strong>Azienda Lazio.0</strong>, il nuovo ente strumentale regionale che avr un ruolo strategico nella <strong>programmazione, gestione e innovazione dei servizi sanitari</strong> del territorio.</p>\",\"258efbfc-a9cb-4cbe-90d0-7de8dd9a8a80\":\"<p>Lobiettivo di Azienda Lazio.0  rafforzare lorganizzazione del Servizio Sanitario Regionale, promuovendo modelli operativi integrati e digitali, e garantendo maggiore efficienza, sostenibilit e prossimit nellerogazione dei servizi ai cittadini.</p><p>Con questa iniziativa, la Regione Lazio compie un passo importante verso la costruzione di un sistema sanitario pi moderno, coordinato e orientato ai bisogni reali delle persone.</p><p>Seguiranno aggiornamenti sulle attivit, i servizi e le modalit di contatto dellAzienda.</p>\",\"e17ff320-1126-4ccf-80d9-c2e1d6b3c6cf\":{\"value\":\"https://www.consiglio.regione.lazio.it/consiglio-regionale/?vw=newsDettaglio&id=2988\",\"type\":\"url\",\"label\":\"Approfondisci\"}}',1,'2025-07-04 05:23:22','2025-07-04 05:23:22','bbdd7f47-4a83-428f-b73b-a8d0c5204199'),
