(1027,1027,1,'Sanzioni per mancata comunicazione dei dati','sanzioni-per-mancata-comunicazione-dei-dati','amministrazione-trasparente/sanzioni-per-mancata-comunicazione-dei-dati','{\"49b374db-35cb-40c5-8d99-1a6c86060047\":[],\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicatii provvedimenti sanzionatori a carico del responsabile della mancata o incompleta comunicazione dei dati di cui all\'articolo 14, concernenti la situazione patrimoniale complessiva del titolare dell\'incarico al momento dell\'assunzione della carica, la titolarit di imprese, le partecipazioni azionarie proprie nonch tutti i compensi cui d diritto l\'assuzione della carica.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\",\"459ebf56-1cc3-4852-82d6-a4c75891f63e\":[]}',1,'2025-07-05 07:33:02','2025-07-05 08:27:28','96100fcf-a492-4f1e-9125-fd666a312210'),
