(1480,1480,1,'Dati relativi ai premi','dati-relativi-ai-premi','amministrazione-trasparente/dati-relativi-ai-premi','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i criteri definiti nei sistemi di misurazione e valutazione della performance per l\'assegnazione del trattamento accessorio, i dati relativi alla sua distribuzione, in forma aggregata, ed i dati relativi al grado di differenziazione nell\'utilizzo della premialit sia per i dirigenti che per i dipendenti.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-05 11:32:09','2025-07-05 11:32:09','370afd4c-a836-44b0-8afe-0419c11b568b'),
