(1666,1666,1,'Accreditamento','accreditamento','tags/accreditamento',NULL,1,'2025-07-06 06:28:31','2025-07-06 06:35:11','57f0c71b-b760-4d2f-81b0-cdab33f7711d'),
(1671,1671,1,'Cosa fa il servizio','cosa-fa-il-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Lazio Zero</strong> si occupa di verificare che tutte le strutture sanitarie accreditate nella Regione garantiscano prestazioni appropriate, sicure e conformi agli standard di qualit previsti dalla normativa regionale e nazionale.<br />Lattivit di controllo riguarda sia l<strong>appropriatezza clinica</strong> (cio laderenza delle prestazioni alle reali esigenze sanitarie del paziente), sia la <strong>qualit dellerogazione</strong>, in termini di sicurezza, efficacia, equit e continuit delle cure.</p>\"}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','be06be41-012e-4128-a74b-351b3ba93a46'),
(1672,1672,1,'Come funziona','come-funziona',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il servizio svolge audit e verifiche periodiche, sia programmati sia su segnalazione, attraverso:</p><ul><li>analisi documentale delle prestazioni erogate</li><li>ispezioni presso le strutture</li><li>valutazioni tramite indicatori di qualit e performance</li><li>confronto con i dati di attivit trasmessi dai sistemi informativi sanitari</li></ul><p>I risultati vengono utilizzati per migliorare i servizi offerti ai cittadini e per mantenere elevati gli standard dellintero sistema sanitario regionale.</p>\"}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','a5fafa19-c59b-4473-8354-9600835d0411'),
(1673,1673,1,'A chi  rivolto','a-chi--rivolto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il sistema prevede percorsi distinti per:</p><ul><li><strong>Fornitori senza contratto di budget:</strong> registrazione, firma digitale dellaccordo, inserimento dati anagrafici e IBAN, trasmissione fatture manuale o via SDI<br /></li><li><strong>Soggetti con contratto di budget:</strong> registrazione tramite email ufficiale, inserimento dati dei presidi, dichiarazione IBAN digitalizzata, invio fatture e, se necessario, allegazione documenti cartacei entro 5 giorni<br /></li><li><strong>Farmacie convenzionate: </strong>allineamento automatico tra anagrafica DCROnline e Sistema Pagamenti, in base al DCA U00032/2017</li></ul>\"}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','342b874d-572c-40bb-8e3b-4556d848a409'),
(1674,1674,1,'Hai bisogno di supporto?','hai-bisogno-di-supporto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Se sei una <strong>struttura sanitaria</strong> e hai ricevuto una comunicazione di verifica, o se hai bisogno di chiarimenti sui requisiti di qualit e appropriatezza:</p><ul><li>consulta la <strong>sezione Documenti e Normativa</strong> dedicata sul portale</li><li>contatta lUfficio Qualit e Accreditamento di Azienda Zero allindirizzo: <strong>[email istituzionale]</strong></li></ul><p>Se sei un <strong>cittadino</strong> e vuoi segnalare un disservizio:</p><ul><li>puoi farlo tramite il servizio <strong>Segnala un problema</strong> allinterno del portale</li><li>oppure rivolgerti all<strong>URP della tua Azienda Sanitaria di riferimento</strong></li></ul>\"}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','cb65a75c-9da5-4854-ac2f-4ac160febb89'),
(1675,1675,1,'Controllo appropriatezza e qualit','controllo-appropriatezza-e-qualit','servizi/controllo-appropriatezza-e-qualit','{\"07cb4be8-fe50-43de-b4d3-45cb5a6f36a9\":{\"date\":\"2025-06-19 07:00:00\"},\"28cf4146-2d58-43ef-a08f-a3a5277ec493\":[15],\"c97ade64-e007-471a-9dc8-7c7b0d97f76f\":[777,789,1665,1666],\"7da44f3a-bb6c-4e30-9e3f-e5255e3dbf02\":\"<p>Verifichiamo che le strutture accreditate garantiscano prestazioni adeguate agli standard qualitativi e normativi regionali.</p>\",\"aa7f1052-35cc-4929-a431-ca8e42271d17\":false}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','2d668f0b-7619-40e5-9022-a86819aeab8a'),
(1676,1676,1,'Cosa fa il servizio','cosa-fa-il-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Lazio Zero</strong> si occupa di verificare che tutte le strutture sanitarie accreditate nella Regione garantiscano prestazioni appropriate, sicure e conformi agli standard di qualit previsti dalla normativa regionale e nazionale.<br />Lattivit di controllo riguarda sia l<strong>appropriatezza clinica</strong> (cio laderenza delle prestazioni alle reali esigenze sanitarie del paziente), sia la <strong>qualit dellerogazione</strong>, in termini di sicurezza, efficacia, equit e continuit delle cure.</p>\"}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','8beee427-e988-4b5b-8462-02b91eb91ac2'),
