(1678,1678,1,'A chi  rivolto','a-chi--rivolto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il sistema prevede percorsi distinti per:</p><ul><li><strong>Fornitori senza contratto di budget:</strong> registrazione, firma digitale dellaccordo, inserimento dati anagrafici e IBAN, trasmissione fatture manuale o via SDI<br /></li><li><strong>Soggetti con contratto di budget:</strong> registrazione tramite email ufficiale, inserimento dati dei presidi, dichiarazione IBAN digitalizzata, invio fatture e, se necessario, allegazione documenti cartacei entro 5 giorni<br /></li><li><strong>Farmacie convenzionate: </strong>allineamento automatico tra anagrafica DCROnline e Sistema Pagamenti, in base al DCA U00032/2017</li></ul>\"}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','f59651c8-061d-41b6-984a-dcfc4112b1c6'),
(1679,1679,1,'Hai bisogno di supporto?','hai-bisogno-di-supporto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Se sei una <strong>struttura sanitaria</strong> e hai ricevuto una comunicazione di verifica, o se hai bisogno di chiarimenti sui requisiti di qualit e appropriatezza:</p><ul><li>consulta la <strong>sezione Documenti e Normativa</strong> dedicata sul portale</li><li>contatta lUfficio Qualit e Accreditamento di Azienda Zero allindirizzo: <strong>[email istituzionale]</strong></li></ul><p>Se sei un <strong>cittadino</strong> e vuoi segnalare un disservizio:</p><ul><li>puoi farlo tramite il servizio <strong>Segnala un problema</strong> allinterno del portale</li><li>oppure rivolgerti all<strong>URP della tua Azienda Sanitaria di riferimento</strong></li></ul>\"}',1,'2025-07-06 06:35:11','2025-07-06 06:35:11','dc2f50ca-dfa1-4b4c-b4f1-9cffd40592a7'),
(1682,1682,1,'Cosa fa il servizio','cosa-fa-il-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Lazio Zero </strong>affianca le Aziende Sanitarie della Regione Lazio nella <strong>definizione, implementazione e coordinamento</strong> di un sistema unico ed efficiente per la gestione del <strong>trattamento economico del personale</strong>.<br />Lobiettivo  garantire omogeneit, trasparenza e correttezza nell\'applicazione delle normative contrattuali e nella gestione degli aspetti retributivi.</p>\"}',1,'2025-07-06 06:37:23','2025-07-06 06:37:23','ebf5d477-8fd2-4ae4-b2f9-1865f54dd152'),
(1683,1683,1,'Supporto nella gestione del personale','controlli-sulla-appropriatezza-e-sulla-qualit-dellassistenza-prestata-dalle-strutture-accreditate','servizi/controlli-sulla-appropriatezza-e-sulla-qualit-dellassistenza-prestata-dalle-strutture-accreditate','{\"07cb4be8-fe50-43de-b4d3-45cb5a6f36a9\":{\"date\":\"2025-05-09 07:00:00\"},\"28cf4146-2d58-43ef-a08f-a3a5277ec493\":[15],\"c97ade64-e007-471a-9dc8-7c7b0d97f76f\":[16,17],\"7da44f3a-bb6c-4e30-9e3f-e5255e3dbf02\":\"<p>Affianchiamo le aziende sanitarie nellindirizzo, nella definizione e nellimplementazione di un sistema unico per la gestione del trattamento economico del personale.</p>\",\"aa7f1052-35cc-4929-a431-ca8e42271d17\":true}',1,'2025-07-06 06:37:23','2025-07-06 06:37:23','6c3941dd-0972-4f2f-906d-22341ecbe813'),
(1684,1684,1,'Cosa fa il servizio','cosa-fa-il-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Lazio Zero </strong>affianca le Aziende Sanitarie della Regione Lazio nella <strong>definizione, implementazione e coordinamento</strong> di un sistema unico ed efficiente per la gestione del <strong>trattamento economico del personale</strong>.<br />Lobiettivo  garantire omogeneit, trasparenza e correttezza nell\'applicazione delle normative contrattuali e nella gestione degli aspetti retributivi.</p>\"}',1,'2025-07-06 06:37:23','2025-07-06 06:37:23','7e61f80f-bd24-4aad-8c34-7ef4587284fb'),
(1690,1690,1,'Come funziona','cosa-fa-il-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il servizio agisce in collaborazione con le Direzioni Risorse Umane delle Aziende Sanitarie, fornendo:</p><ul><li><strong>supporto</strong> nellapplicazione uniforme dei <strong>contratti collettivi nazionali e integrativi</strong></li><li><strong>assistenza tecnica e operativa </strong>nella gestione del trattamento economico</li><li>implementazione di procedure standard per la rilevazione e il <strong>controllo della spesa</strong> del personale</li><li><strong>sviluppo e aggiornamento </strong>di strumenti digitali condivisi</li></ul>\"}',1,'2025-07-06 06:41:04','2025-07-06 06:41:04','0c9ab652-5f5d-46de-9a7b-c7cd77847fd0'),
(1691,1691,1,'A chi  rivolto','a-chi--rivolto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il servizio  rivolto alle:</p><ul><li><strong>Aziende Sanitarie Locali, Aziende Ospedaliere e IRCCS pubblici</strong> della Regione Lazio</li><li><strong>Direzioni Amministrative e Risorse Umane</strong>, che operano quotidianamente nella gestione del personale</li><li><strong>Enti regionali del SSR</strong> coinvolti nei processi di controllo e monitoraggio della spesa</li></ul>\"}',1,'2025-07-06 06:41:04','2025-07-06 06:41:04','f7a68721-c902-420c-9f5e-914c9b1080ff'),
(1692,1692,1,'Come accedere o fruire del servizio','come-accedere-o-fruire-del-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Le Aziende Sanitarie sono coinvolte direttamente da <strong>Lazio Zero</strong> attraverso:</p><ul><li>incontri periodici di coordinamento</li><li>aggiornamenti normativi condivisi</li><li>piattaforme e strumenti digitali messi a disposizione in cloud</li></ul><p>Ogni struttura dispone di un canale diretto con i referenti del servizio per ricevere supporto tecnico o richiedere interventi specifici.</p>\"}',1,'2025-07-06 06:41:04','2025-07-06 06:41:04','9bc604b5-9950-49c6-9727-11981eb5dd4d'),
(1693,1693,1,'Hai bisogno di supporto?','hai-bisogno-di-supporto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Se sei una <strong>struttura sanitaria</strong> e necessiti di assistenza sulla gestione del trattamento economico del personale:</p><ul><li>consulta la <strong>documentazione tecnica</strong> disponibile sul portale</li><li>scrivi al <strong>Servizio Gestione del Personale di Lazio Zero</strong> allindirizzo: <strong>[email istituzionale]</strong></li></ul>\"}',1,'2025-07-06 06:41:04','2025-07-06 06:41:04','f0a9fac1-150f-4b7b-8017-13f868a071c8'),
(1694,1694,1,'Supporto nella gestione del personale','controlli-sulla-appropriatezza-e-sulla-qualit-dellassistenza-prestata-dalle-strutture-accreditate','servizi/controlli-sulla-appropriatezza-e-sulla-qualit-dellassistenza-prestata-dalle-strutture-accreditate','{\"07cb4be8-fe50-43de-b4d3-45cb5a6f36a9\":{\"date\":\"2025-05-09 07:00:00\"},\"28cf4146-2d58-43ef-a08f-a3a5277ec493\":[15],\"c97ade64-e007-471a-9dc8-7c7b0d97f76f\":[16,17],\"7da44f3a-bb6c-4e30-9e3f-e5255e3dbf02\":\"<p>Affianchiamo le aziende sanitarie nellindirizzo, nella definizione e nellimplementazione di un sistema unico per la gestione del trattamento economico del personale.</p>\",\"aa7f1052-35cc-4929-a431-ca8e42271d17\":true}',1,'2025-07-06 06:41:04','2025-07-06 06:41:04','544e7832-ae90-4592-99d9-18699b1eb217'),
