(1697,1697,1,'Come accedere o fruire del servizio','come-accedere-o-fruire-del-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Le Aziende Sanitarie sono coinvolte direttamente da <strong>Lazio Zero</strong> attraverso:</p><ul><li>incontri periodici di coordinamento</li><li>aggiornamenti normativi condivisi</li><li>piattaforme e strumenti digitali messi a disposizione in cloud</li></ul><p>Ogni struttura dispone di un canale diretto con i referenti del servizio per ricevere supporto tecnico o richiedere interventi specifici.</p>\"}',1,'2025-07-06 06:41:04','2025-07-06 06:41:04','7d107326-2717-4dba-a1b6-611066ccc932'),
(1698,1698,1,'Hai bisogno di supporto?','hai-bisogno-di-supporto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Se sei una <strong>struttura sanitaria</strong> e necessiti di assistenza sulla gestione del trattamento economico del personale:</p><ul><li>consulta la <strong>documentazione tecnica</strong> disponibile sul portale</li><li>scrivi al <strong>Servizio Gestione del Personale di Lazio Zero</strong> allindirizzo: <strong>[email istituzionale]</strong></li></ul>\"}',1,'2025-07-06 06:41:04','2025-07-06 06:41:04','dfbba8c5-1508-4619-b074-2af7e0f1b2f9'),
(1705,1705,1,'Cosa fa il servizio','cosa-fa-il-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Lazio Zero</strong> affianca le Aziende del Servizio Sanitario Regionale nella <strong>semplificazione, armonizzazione e digitalizzazione</strong> dei processi contabili e amministrativi.<br />Lobiettivo  garantire una <strong>gestione economico-finanziaria efficiente, trasparente e omogenea</strong>, in linea con le normative regionali e nazionali.</p>\"}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','25b9e75a-aeb0-4721-9902-bb1ea3f5db37'),
(1706,1706,1,'Come funziona','come-funziona',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il servizio opera attraverso:</p><ul><li>lelaborazione di <strong>linee guida comuni</strong> per la gestione contabile</li><li>la diffusione di <strong>strumenti digitali condivisi</strong>, capaci di standardizzare i processi</li><li>il monitoraggio della <strong>coerenza dei bilanci</strong> e dei flussi economici</li><li>il <strong>supporto operativo</strong> nella gestione delle registrazioni contabili, degli adempimenti fiscali e della rendicontazione</li></ul><p>Il lavoro congiunto permette una lettura centralizzata dei dati, utile sia al governo regionale che alle singole aziende per la programmazione e il controllo.</p>\"}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','4d27f428-81c2-460f-82c3-28ed2d22ef3d'),
(1707,1707,1,'A chi  rivolto','a-chi--rivolto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il servizio si rivolge a:</p><ul><li><strong>Aziende Sanitarie Locali, Aziende Ospedaliere e IRCCS pubblici</strong> del Servizio Sanitario Regionale</li><li><strong>Direzioni Amministrative, Uffici Finanziari e Contabili</strong>, coinvolti nella gestione economica</li><li><strong>Regione Lazio</strong>, in qualit di ente di indirizzo e controllo dei flussi finanziari del sistema sanitario</li></ul>\"}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','b77cd353-7788-4caa-8a31-9f82f26ee7f2'),
(1708,1708,1,'Come accedere o fruire del servizio','come-accedere-o-fruire-del-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Lazio Zero</strong> lavora in stretta collaborazione con le Aziende, attraverso:</p><ul><li>ladozione di sistemi contabili condivisi e interoperabili</li><li>la messa a disposizione di modelli, manuali operativi e strumenti standard</li><li>tavoli tecnici di confronto e aggiornamento<br />Le aziende possono ricevere supporto mirato su singoli processi o su iniziative di efficientamento pi ampie.</li></ul>\"}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','634ef08a-9aa8-49e1-a3a6-d2e6a1905a3e'),
(1709,1709,1,'Hai bisogno di supporto?','hai-bisogno-di-supporto',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Se sei un referente amministrativo-contabile e hai bisogno di assistenza:</p><ul><li>consulta la <strong>documentazione operativa</strong> disponibile nellarea riservata del portale</li><li>contatta il <strong>Servizio Contabilit e Bilancio di Lazio Zero</strong> allindirizzo: <strong>[email istituzionale]</strong></li><li>oppure partecipa ai <strong>gruppi di lavoro e agli incontri tecnici</strong> programmati periodicamente</li></ul>\"}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','09998296-78b0-44c2-9f7b-ff6d2fd347dc'),
(1710,1710,1,'Supporto nella contabilit','servizio-03','servizi/servizio-03','{\"07cb4be8-fe50-43de-b4d3-45cb5a6f36a9\":{\"date\":\"2025-05-09 07:00:00\"},\"28cf4146-2d58-43ef-a08f-a3a5277ec493\":[15],\"c97ade64-e007-471a-9dc8-7c7b0d97f76f\":[777,788],\"7da44f3a-bb6c-4e30-9e3f-e5255e3dbf02\":\"<p>Semplifichiamo e uniformiamo i processi amministrativo-contabili delle Aziende del servizio sanitario regionale attraverso strumenti e linee guida condivisi.</p>\",\"aa7f1052-35cc-4929-a431-ca8e42271d17\":true}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','9fc0fdeb-b634-4143-9463-adb9f42e43a1'),
(1711,1711,1,'Cosa fa il servizio','cosa-fa-il-servizio',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><strong>Lazio Zero</strong> affianca le Aziende del Servizio Sanitario Regionale nella <strong>semplificazione, armonizzazione e digitalizzazione</strong> dei processi contabili e amministrativi.<br />Lobiettivo  garantire una <strong>gestione economico-finanziaria efficiente, trasparente e omogenea</strong>, in linea con le normative regionali e nazionali.</p>\"}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','bb79c78d-75ee-4b5e-81d8-44dde2503c0c'),
(1712,1712,1,'Come funziona','come-funziona',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":false,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p>Il servizio opera attraverso:</p><ul><li>lelaborazione di <strong>linee guida comuni</strong> per la gestione contabile</li><li>la diffusione di <strong>strumenti digitali condivisi</strong>, capaci di standardizzare i processi</li><li>il monitoraggio della <strong>coerenza dei bilanci</strong> e dei flussi economici</li><li>il <strong>supporto operativo</strong> nella gestione delle registrazioni contabili, degli adempimenti fiscali e della rendicontazione</li></ul><p>Il lavoro congiunto permette una lettura centralizzata dei dati, utile sia al governo regionale che alle singole aziende per la programmazione e il controllo.</p>\"}',1,'2025-07-06 06:44:33','2025-07-06 06:44:33','501e0aff-39fb-430b-b60c-1342791b3f39'),
