(2332,2332,1,'Pianificazione e governo del territorio','pianificazione-e-governo-del-territorio','amministrazione-trasparente/pianificazione-e-governo-del-territorio','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati gli atti di governo del territorio quali, tra gli altri, piani territoriali, piani di coordinamento, piani paesistici, strumenti urbanistici, generali e di attuazione, nonch le loro varianti, e la documentazione relativa a ciascun procedimento di presentazione ed approvazione delle proposte di trasformazione urbanistica di iniziativa privata o pubblica in variante allo strumento urbanistico generale comunque denominato vigente, nonch delle proposte di trasformazione urbanistica di iniziativa privata o pubblica in attuazione dello strumento urbanistico generale vigente che comportino premialit edificatorie a fronte dell\'impegno dei privati alla realizzazione di opere di urbanizzazione extra oneri o della cessione di aree o volumetrie per finalit di pubblico interesse.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 09:56:48','2025-07-10 09:56:48','b05a6dee-1157-485b-a812-5acd42e39835'),
