(2336,2336,1,'Informazioni ambientali','informazioni-ambientali','amministrazione-trasparente/informazioni-ambientali','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i dati e le informazioni ambientali che le amministrazioni detengono ai fini delle proprie attivit istituzionali: lo stato dell\'ambiente, i fattori inquinanti, le misure incidenti sull\'ambiente e relative analisi di impatto, le misure a protezione dell\'ambiente e relative analisi di impatto, le relazioni sull\'attuazione della legislazione, lo stato della salute e della sicurezza umana, la relazione sullo stato dell\'ambiente del Ministero dell\'Ambiente e della tutela del territorio.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 09:56:58','2025-07-10 09:56:58','d0c52921-65f4-4218-8b2c-b0da67e1dccc'),
