(2450,2450,1,'Enti pubblici vigilati','enti-pubblici-vigilati','amministrazione-trasparente/enti-pubblici-vigilati','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i dati sugli enti pubblici, comunque denominati, istituiti, vigilati e finanziati dall\'amministrazione ovvero per i quali l\'amministrazione abbia il potere di nomina degli amministratori dell\'ente, con l\'indicazione delle funzioni attribuite e delle attivit svolte in favore dell\'amministrazione o delle attivit di servizio pubblico affidate.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:15:16','2025-07-10 11:15:16','fff2b998-06b2-4790-9454-67f39176c707'),
(2451,2451,1,'Riferimenti Normativi','riferimenti-normati',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":true,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><a href=\\\"http://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-03-14;33!vig=~art22\\\"><u>Art. 22 c. 1 lett. a), c. 2, c. 3 D.Lgs. 33/2013</u></a></p><p><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-04-08;39!vig=~art20\\\"><u>Art. 20 c. 3 D.Lgs. 39/2013</u></a></p>\"}',1,'2025-07-10 11:15:16','2025-07-10 11:15:16','5d1c2419-40f0-4511-a76e-43790196b9bd'),
(2455,2455,1,'Societ partecipate','societa-partecipate','amministrazione-trasparente/societa-partecipate','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i dati sulle societ di cui l\'Ente detiene direttamente quote di partecipazione anche minoritaria, nonch i provvedimenti in materia di costituzione, acquisto, gestione ed alienazione di partecipazioni e quotazioni di societ in controllo pubblico.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:15:55','2025-07-10 11:15:55','ca7755a6-60c2-4834-b59a-004212f00a39'),
