(2457,2457,1,'Indice delle Societ partecipate','indice',NULL,NULL,1,'2025-07-10 11:15:55','2025-07-10 11:15:55','7f82a433-e9b2-4fc0-86a4-0356e7e626ee'),
(2460,2460,1,'Enti di diritto privato controllati','enti-di-diritto-privato-controllati','amministrazione-trasparente/enti-di-diritto-privato-controllati','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i dati sugli enti di diritto privato, comunque denominati, in controllodell\'Amministrazione, oppure gli enti costituiti o vigilati nei quali siano riconosciuti all\'Amministrazione, anche in assenza di una partecipazione azionaria, poteri di nomina dei vertici o dei componenti degli organi.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:16:22','2025-07-10 11:16:22','e33c9950-a3f2-4298-88ac-1418f5d54b8e'),
(2461,2461,1,'Riferimenti Normativi','riferimenti-normativi',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":true,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><a href=\\\"http://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-03-14;33!vig=~art22\\\"><u>Art. 22 c. 1 lett. c), c. 2, c. 3 D.Lgs. 33/2013</u></a></p><p><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-04-08;39!vig=~art20\\\"><u>Art. 20 c. 3 D.Lgs. 39/2013</u></a></p>\"}',1,'2025-07-10 11:16:22','2025-07-10 11:16:22','29ebe53a-a910-4196-91c3-27d106c2b849'),
(2464,2464,1,'Tipologie di procedimento','tipologie-di-procedimento','amministrazione-trasparente/tipologie-di-procedimento','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicatii dati relativi alle tipologie di procedimento di propria competenza.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:16:55','2025-07-10 11:16:55','b55b4828-aaff-468c-addb-c2c9b052718e'),
(2465,2465,1,'Riferimenti Normatvi','riferimenti-normatvi',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":true,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><a href=\\\"http://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-03-14;33!vig=~art35\\\"><u>Art. 35 c. 1 lett- a)-m) D.Lgs. 33/2013</u></a></p><p><a href=\\\"https://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:legge:2012-11-06;190!vig=~art1\\\"><u>Art. 1 c. 29 L. 190/2012</u></a></p>\"}',1,'2025-07-10 11:16:55','2025-07-10 11:16:55','bb989762-cd71-41e7-aa2a-cbaef4b886b2'),
(2468,2468,1,'Provvedimenti organi indirizzo politico','provvedimenti-organi-indirizzo-politico','amministrazione-trasparente/provvedimenti-organi-indirizzo-politico','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati gli elenchi semestrali dei provvedimenti adottati dagli organi di indirizzo politico, con particolare riferimento ai provvedimenti finali dei procedimenti di scelta del contraente per l\'affidamento di lavori, forniture e servizi, anche con riferimento alla modalit di selezione prescelta, ed agli accordi stipulati dall\'Amministrazione con soggetti privati o con altre amministrazioni pubbliche.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:17:55','2025-07-10 11:17:55','6c737ba3-03e9-4200-9302-da4e509ec7b2'),
