(2472,2472,1,'Provvedimenti dirigenti amministrativi','provvedimenti-dirigenti-amministrativi','amministrazione-trasparente/provvedimenti-dirigenti-amministrativi','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati gli elenchi semestrali dei provvedimenti adottati dai dirigenti amministrativi, con particolare riferimento ai provvedimenti finali dei procedimenti di scelta del contraente per l\'affidamento di lavori, forniture e servizi, anche con riferimento alla modalit di selezione prescelta, ed agli accordi stipulati dall\'Amministrazione con soggetti privati o con altre amministrazioni pubbliche.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:18:21','2025-07-10 11:18:21','f5318c6d-b8ba-44b4-a573-3a00bd0d0e58'),
