(2476,2476,1,'Informazioni sulle singole procedure in formato tabellare','informazioni-sulle-singole-procedure-in-formato-tabellare','amministrazione-trasparente/informazioni-sulle-singole-procedure-in-formato-tabellare','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i datiprevisti dall\'art. 1 c. 32 L. 190/2012 e le relative tabelle riassuntive rese liberamente scaricabili in un formato digitale standard aperto con informazioni sui contratti relative all\'anno precedente.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:19:11','2025-07-10 11:19:11','a63f2f4d-adb4-4f65-8092-8826e4db71b2'),
