(2480,2480,1,'Atti relativi alle procedure per l\'affidamento di appalti','atti-relativi-alle-procedure-per-laffidamento-di-appalti','amministrazione-trasparente/atti-relativi-alle-procedure-per-laffidamento-di-appalti','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati gli atti relativi alle procedure per l\'affidamento di appalti pubblici di servizi, forniture, lavori e opere, di concorsi pubblici di progettazione, di concorsi di idee e di concessioni, compresi quelli tra enti nell\'ambito del settore pubblico di cui all\'art. 5 D.Lgs. 50/2016.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:20:05','2025-07-10 11:20:05','0b85cc99-b8ff-4064-92c6-fc4bf98f9bd7'),
(2481,2481,1,'Riferimenti Normativi','riferimenti-normativi',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":true,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><a href=\\\"http://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-03-14;33!vig=~art37\\\"><u>Art. 37 c. 1 lett. b) D.Lgs. 33/2013</u></a></p><p><a href=\\\"http://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2016-04-18;50!vig=~art29\\\"><u>Art. 29 c. 1 D.Lgs. 50/2016</u></a></p>\"}',1,'2025-07-10 11:20:05','2025-07-10 11:20:05','4aafe8d1-5f9a-431b-bc98-e43405c43878'),
(2484,2484,1,'Criteri e modalit di concessione','criteri-e-modalit-di-concessione','amministrazione-trasparente/criteri-e-modalit-di-concessione','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati gli atti con i quali sono determinati i criteri e le modalit cui le amministrazioni devono attenersi per la concessione di sovvenzioni, contributi, sussidi ed ausili finanziari e l\'attribuzione di vantaggi economici di qualunque genere a persone ed enti pubblici e privati.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Ammiistrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:20:52','2025-07-10 11:20:52','1898c338-3e2a-44c0-b584-c26bb43a4a99'),
