(2488,2488,1,'Atti di concessione','atti-di-concessione','amministrazione-trasparente/atti-di-concessione','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i dati relativi agli atti di concessione di sovvenzioni, contributi, sussidi ed ausili finanziari alle imprese e di vantaggi economici di qualunque genere a persone ed enti pubblici e privati di importo superiore a mille euro.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 11:21:16','2025-07-10 11:21:16','85abbf6f-c59c-4251-8715-88414e7a3c3c'),
(2489,2489,1,'Riferimenti Normativi','riferimenti-normativi',NULL,'{\"f7279620-f7df-4839-814a-405102aa8253\":true,\"4de44a40-a96d-4d2a-8aa4-6d74f94460eb\":\"<p><a href=\\\"http://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-03-14;33!vig=~art26\\\"><u>Art. 26 c. 2 D.Lgs. 33/2013</u></a></p><p><a href=\\\"http://www.normattiva.it/uri-res/N2Ls?urn:nir:stato:decreto.legislativo:2013-03-14;33!vig=~art27\\\"><u>Art. 27 c. 1 lett. a)-f), c. 2 D.Lgs. 33/2013</u></a></p>\"}',1,'2025-07-10 11:21:16','2025-07-10 11:21:16','d879fe23-b66f-4011-aaae-b4a5c245adbe'),
