(2540,2540,1,'IBAN e pagamenti informatici','iban-e-pagamenti-informatici','amministrazione-trasparente/iban-e-pagamenti-informatici','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicati i codici IBAN identificativi del conto di pagamento, ovvero di imputazione del versamento in Tesoreria, tramite i quali i soggetti versanti possono effettuare i pagamenti mediante bonifico bancario o postale, ovvero gli identificativi del conto corrente postale sul quale i soggetti versanti possono effettuare i pagamenti mediante bollettino postale, nonch i codici identificativi del pagamento da indicare obbligatoriamente per il versamento.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 12:39:26','2025-07-10 12:39:26','1b87df78-42ee-4dcd-8583-3c4fb550e211'),
