(2544,2544,1,'Dati sui pagamenti del servizio sanitario nazionale','dati-sui-pagamenti-del-servizio-sanitario-nazionale','amministrazione-trasparente/dati-sui-pagamenti-del-servizio-sanitario-nazionale','{\"20a66062-cc25-4e51-ba06-5816289ee17d\":\"<p>In questa sezione vengono pubblicatii dati relativi a tutte le spese ed a tutti i pagamenti effettuati dagli enti del Servizio Sanitario Nazionale, distinti per tipologia di lavoro, bene o servizio, in relazione alla tipologia di spesa sostenuta, all\'ambito temporale di riferimento ed ai beneficiari.</p>\",\"5d81d064-70c2-4457-a442-afa9fb3f459c\":true,\"d7fea679-0f20-40d7-8d41-3719ee26c12c\":\"Amministrazione Trasparente\",\"c59483c0-e2dd-487e-a563-9a57a381fd7b\":\"amministrazioneTrasparente\"}',1,'2025-07-10 12:39:47','2025-07-10 12:39:47','c97e199a-d01f-479a-aec1-6e2c04305a4e'),
