ziamenti e contributi per un importo che nellanno superi 5 000 EUR 4 attestazione concernente le variazioni della situazione patrimoniale intervenute nellanno precedente e copia della dichiarazione dei redditi per il soggetto il coniuge non separato e i parenti entro il secondo grado ove gli stessi vi consentano nb dando eventualmente evidenza del mancato consenso '),
