(710,'field',2,1,' per ciascuna tipologia di procedimento breve descrizione del procedimento con indicazione di tutti i riferimenti normativi utili unita organizzative responsabili dellistruttoria ufficio del procedimento unitamente ai recapiti telefonici e alla casella di posta elettronica istituzionale ove diverso ufficio competente alladozione del provvedimento finale con indicazione del nome del responsabile dellufficio unitamente ai rispettivi recapiti telefonici e alla casella di posta elettronica istituzionale modalita con le quali gli interessati possono ottenere le informazioni relative ai procedimenti in corso che li riguardino termine fissato in sede di disciplina normativa del procedimento per la conclusione con adozione di un provvedimento espresso e ogni altro termine procedimentale rilevante procedimenti per i quali il provvedimento dellamministrazione puo essere sostituito da una dichiarazione dellinteressato ovvero il procedimento puo concludersi con il silenzio assenso dellamministrazione strumenti di tutela amministrativa e giurisdizionale riconosciuti dalla legge in favore dellinteressato nel corso del procedimento nei confronti del provvedimento finale ovvero nei casi di adozione del provvedimento oltre il termine predeterminato per la sua conclusione e i modi per attivarli link di accesso al servizio on line ove sia gia disponibile in rete o tempi previsti per la sua attivazione modalita per effettuazione dei pagamenti eventualmente necessari con i codici iban identificativi del conto di pagamento ovvero di imputazione del versamento in tesoreria tramite i quali i soggetti versanti possono effettuare i pagamenti mediante bonifico bancario o postale ovvero gli identificativi del conto corrente postale sul quale i soggetti versanti possono effettuare i pagamenti mediante bollettino postale nonche i codici identificativi del pagamento da indicare obbligatoriamente per il versamento nome del soggetto a cui e attribuito in caso di inerzia il potere sostitutivo nonche modalita per attivare tale potere con indicazione dei recapiti telefonici e delle caselle di posta elettronica istituzionale riferimenti normativi art 35 c 1 lett a d lgs n 33 2013 art 35 c 1 lett b d lgs n 33 2013 art 35 c 1 lett c d lgs n 33 2013 art 35 c 1 lett c d lgs n 33 2013 art 35 c 1 lett e d lgs n 33 2013 art 35 c 1 lett f d lgs n 33 2013 art 35 c 1 lett g d lgs n 33 2013 art 35 c 1 lett h d lgs n 33 2013 art 35 c 1 lett i d lgs n 33 2013 art 35 c 1 lett l d lgs n 33 2013 art 35 c 1 lett m d lgs n 33 2013 procedimenti ad istanza di parte atti e documenti da allegare allistanza e modulistica necessaria compresi i fac simile per le autocertificazioni uffici ai quali rivolgersi per informazioni orari e modalita di accesso con indicazione degli indirizzi recapiti telefonici e caselle di posta elettronica istituzionale a cui presentare le istanze riferimenti normativi art 35 c 1 lett d d lgs n 33 2013 art 35 c 1 lett d d lgs n 33 2013 e art 1 c 29 l 190 2012 sezione in costruzione '),
