(1671,'field',2,1,' lazio zero si occupa di verificare che tutte le strutture sanitarie accreditate nella regione garantiscano prestazioni appropriate sicure e conformi agli standard di qualita previsti dalla normativa regionale e nazionale attivita di controllo riguarda sia appropriatezza clinica cioe aderenza delle prestazioni alle reali esigenze sanitarie del paziente sia la qualita dellerogazione in termini di sicurezza efficacia equita e continuita delle cure '),
(1671,'slug',0,1,' cosa fa il servizio '),
(1671,'title',0,1,' cosa fa il servizio '),
(1672,'field',2,1,' il servizio svolge audit e verifiche periodiche sia programmati sia su segnalazione attraverso analisi documentale delle prestazioni erogate ispezioni presso le strutture valutazioni tramite indicatori di qualita e performance confronto con i dati di attivita trasmessi dai sistemi informativi sanitari i risultati vengono utilizzati per migliorare i servizi offerti ai cittadini e per mantenere elevati gli standard dellintero sistema sanitario regionale '),
(1672,'slug',0,1,' come funziona '),
(1672,'title',0,1,' come funziona '),
(1673,'field',2,1,' il sistema prevede percorsi distinti per fornitori senza contratto di budget registrazione firma digitale dellaccordo inserimento dati anagrafici e iban trasmissione fatture manuale o via sdi soggetti con contratto di budget registrazione tramite email ufficiale inserimento dati dei presidi dichiarazione iban digitalizzata invio fatture e se necessario allegazione documenti cartacei entro 5 giorni farmacie convenzionate allineamento automatico tra anagrafica dcronline e sistema pagamenti in base al dca u00032 2017 '),
(1673,'slug',0,1,' a chi e rivolto '),
(1673,'title',0,1,' a chi e rivolto '),
(1674,'field',2,1,' se sei una struttura sanitaria e hai ricevuto una comunicazione di verifica o se hai bisogno di chiarimenti sui requisiti di qualita e appropriatezza consulta la sezione documenti e normativa dedicata sul portale contatta ufficio qualita e accreditamento di azienda zero allindirizzo email istituzionale se sei un cittadino e vuoi segnalare un disservizio puoi farlo tramite il servizio segnala un problema allinterno del portale oppure rivolgerti allurp della tua azienda sanitaria di riferimento '),
(1674,'slug',0,1,' hai bisogno di supporto '),
(1674,'title',0,1,' hai bisogno di supporto '),
(1682,'field',2,1,' lazio zero affianca le aziende sanitarie della regione lazio nella definizione implementazione e coordinamento di un sistema unico ed efficiente per la gestione del trattamento economico del personale obiettivo e garantire omogeneita trasparenza e correttezza nellapplicazione delle normative contrattuali e nella gestione degli aspetti retributivi '),
(1682,'slug',0,1,' cosa fa il servizio '),
(1682,'title',0,1,' cosa fa il servizio '),
(1690,'field',2,1,' il servizio agisce in collaborazione con le direzioni risorse umane delle aziende sanitarie fornendo supporto nellapplicazione uniforme dei contratti collettivi nazionali e integrativi assistenza tecnica e operativa nella gestione del trattamento economico implementazione di procedure standard per la rilevazione e il controllo della spesa del personale sviluppo e aggiornamento di strumenti digitali condivisi '),
(1690,'slug',0,1,' cosa fa il servizio '),
(1690,'title',0,1,' come funziona '),
(1691,'field',2,1,' il servizio e rivolto alle aziende sanitarie locali aziende ospedaliere e irccs pubblici della regione lazio direzioni amministrative e risorse umane che operano quotidianamente nella gestione del personale enti regionali del ssr coinvolti nei processi di controllo e monitoraggio della spesa '),
