(1691,'title',0,1,' a chi e rivolto '),
(1692,'field',2,1,' le aziende sanitarie sono coinvolte direttamente da lazio zero attraverso incontri periodici di coordinamento aggiornamenti normativi condivisi piattaforme e strumenti digitali messi a disposizione in cloud ogni struttura dispone di un canale diretto con i referenti del servizio per ricevere supporto tecnico o richiedere interventi specifici '),
